import React, { Component } from 'react';
import Header from './Header';
import Meta from '../components/Meta';
import styled from 'styled-components';

const MyButton = styled.button`
  background: red;
  font-size: 100px;
  span {
      font-size: 200px;
  }
`;

class Page extends Component {
    render() {
        return (
            <div>
            <Meta />
            <Header />
            <MyButton>
                Click Me
                <span>$</span>
            </MyButton>
            {this.props.children}   
            </div>
        );
    }
}

export default Page;
